import React from "react"
import { Link } from "react-router-dom"
import ShoppingCartLineIcon from 'remixicon-react/ShoppingCartLineIcon'

function Header() {
    return (
        <header>
            <h2><Link to='/pages/photo.js'>Pic Some</Link></h2>
            <Link to='/pages/cart'></Link><ShoppingCartLineIcon className="ri-shopping-cart-line ri-fw ri-2x"/>
        </header>
    )
}

export default Header
